export default class Body extends Component {
    render() {
        return (
            <div style={bodyStyle}>
                <div style={titleStyle}>Recently Added</div>
            </div>
        )
    }
}

const bodyStyle = {
    backgroundColor:'#008000',
    color:'#FFF',
    padding:'20px',
    fontSize:'20px',
    borderRadius:'3% 0%',
    borderBottom:'1px #004000 solid'
